import React from 'react';
import { AppBar, Toolbar, Typography, Button } from "@material-ui/core";
import { Link } from 'react-router-dom';
import { Label } from '@thumbtack/thumbprint-react';


const Header = () => {

    const logo  = (
        <Typography variant="h6" component="h1">
            SNP-LAMP DESIGNER
        </Typography> 
    );

    return (
        <header>
            <AppBar className='header'>
                <Toolbar>
                    {logo}
                    <Button {...{key: 'Home', color: 'inherit', to: '/', component: Link}}>Home</Button>
                    <Button {...{key: 'About', color: 'inherit', to: '/about', component: Link}}>About</Button>
                    <Button {...{key: 'Tutorial', color: 'inherit', to: '/tutorial', component: Link}}>Tutorial</Button>
                </Toolbar>
            </AppBar>
        </header>
    );
};

export default Header;
